package com.yskj.models;import com.yskj.aop.StorageChild;import jdk.nashorn.internal.ir.annotations.Ignore;import lombok.Data;import java.util.Date;import java.util.List;//表名称 insrecord@Datapublic class InsRecord extends BaseEntity {	private static final long serialVersionUID = 1L;	public InsRecord() {		super();	}	    //费用表ID    private String feeID;    //类型表ID    private String typeID;    //企业名称    private String enterpriseName;    //职业ID    private String professionID;    //生效日期    private Date date;    @Ignore    private String count ;    //是否已经上传    private Integer status;    @StorageChild(refColumn = "professionID")    private InsProfessionType insProfessionType ;    @StorageChild(refColumn = "feeID")    private InsFee insFee ;    @StorageChild(revColumn = "recordID")    private List<InsRecordPerson> insRecordPersonList ;    @StorageChild(refColumn = "typeID")    private InsType insType ;}